const SchoolInfo = () => {
  return (
    <div className="school-info">
      <h2>School Information</h2>
      <p>
        Jahanara Israil School & College is a renowned educational institution located in Barishal, Bangladesh.
      </p>
      <p>
        Address: P955+VHF, 999 College Row, Barishal 8200
      </p>
      <p>
        Phone: +880 1234567890
      </p>
      <p>
        Email: [info@jischool.edu](mailto:info@jischool.edu)
      </p>
    </div>
  );
};

export default SchoolInfo;
